import React from 'react';
import styled from 'styled-components';
import palette from '../../lib/styles/palette';
import Responsive from '../common/Responsive';
import { Link } from 'react-router-dom';

const MainSubMenuBackground = styled.div`
  width: 100%;
  background-image: url('https://cdn.pixabay.com/photo/2017/05/13/18/36/cat-2310384_960_720.jpg');
`;

const MainSubMenuHolder = styled(Responsive)`
  height: 20rem;
  display: flex;
  justify-content: space-between;
`;

const SubMenuItem = styled.div`
  width: 17%;
`;

const SubMenuCircle = styled.div`
  width: 100%;
  height: 100%;
  border: 1px solid blue;
  border-radius: 50%;
`;

const SubMenuItemTitleHolder = styled.div`
  width: 100%;
`;

const MainSubMenu = () => {
  return (
    <MainSubMenuBackground>
      <MainSubMenuHolder>
        <SubMenuItem>
          <SubMenuCircle />
          <SubMenuItemTitleHolder>
            <h1>asdf</h1>
            <p>asdfasdf</p>
          </SubMenuItemTitleHolder>
        </SubMenuItem>
        <SubMenuItem>
          <SubMenuCircle />
        </SubMenuItem>
        <SubMenuItem>
          <SubMenuCircle />
        </SubMenuItem>
        <SubMenuItem>
          <SubMenuCircle />
        </SubMenuItem>
        <SubMenuItem>
          <SubMenuCircle />
        </SubMenuItem>
      </MainSubMenuHolder>
    </MainSubMenuBackground>
  );
};

export default MainSubMenu;
